Imagine seeing a 20 storey tower flying into space and then landing itself upright. 

This will never stop blowing my mind. 🤯 

@elonmusk @SpaceX https://t.co/JYCwaV6bvy

Me tomó 365 días para realizarla; 
La imagen que les comparto la inicié el 24 de diciembre de 2018, tomando una imagen diaria de nuestra estrella el Sol, a las 17:00 (horario de invierno) durante todo el año.

Este es el resultado hasta esta tarde. Agradecería un RT. https://t.co/C3XMYBVmAC

